// CardView.js
import React, { useState } from "react";
import Card from "./Card";
import "./CardView.css";

const newcarddata = (data) => {
  let count = data.count;
  let newcard = [];
  for (let i = 0; i < count; i++) {
    newcard.push({
      id: i + 1,
      volume: data.volume[i],
      Rupee: data.Rupee[i],
    });
  }
  return newcard;
};

function CardView(props) {
  const card = props.cards.filter((item) => item.id === 2);
  console.log(card);

  const [data, setData] = useState(newcarddata(card));

  console.log(data);

  return (
    <div className="card-view">
      {(Card) => (
        <Card key={card.id} volume={card.volume[1]} Rupee={card.Rupee} />
      )}
    </div>
  );
}

export default CardView;
